import { ReactElement, useState } from 'react';
import AppBar from './AppBar';

import { AppParams } from './apps/AppParams';
import WorkingMemory from './apps/working-memory/WorkingMemory';

type MainParams = {
  appName: string,
}

const apps: {[key:string]: ((params:AppParams) => ReactElement) } = {
  'WorkingMemory': WorkingMemory,
}

export default function Main() {
  const [currentAppName, setCurrentAppName] = useState('WorkingMemory');

  return (
    <div>
      <AppBar/>
      {apps[currentAppName] ?? <div/>}
    </div>
  );
}
